impl Solution {
    pub fn max_partitions_after_operations(s: String, k: i32) -> i32 {
        let s = s.as_bytes();
        let mut ans = 1;

        for i in 0..26 {
            let mut cnt = vec![0; 26];
            let mut tot = 0;
            let mut l = 0;
            let mut res = 0;
            for r in 0..s.len() {
                if cnt[(s[r] - b'a') as usize] == 0 {
                    tot += 1;
                }
                cnt[(s[r] - b'a') as usize] += 1;
                while tot > k || (tot == k && cnt[i] == 0) {
                    cnt[(s[l] - b'a') as usize] -= 1;
                    if cnt[(s[l] - b'a') as usize] == 0 {
                        tot -= 1;
                    }
                    l += 1;
                }
                if r + 1 == s.len() || s[r] != s[r + 1] {
                    res += 1;
                }
            }
            ans = ans.max(res);
        }
        ans
    }
}
